r_4:"Amanda Marron",article_1:"Comment supprimer efficacement le texte des images",article_2:"Comment augmenter la taille de l'image de Ko à Mo sans endommager la qualité",article_3:"Comment supprimer le filigrane Getty Images sur Windows et Mac",article_4:"La meilleure méthode pour convertir une image basse résolution en haute résolution en ligne gratuitement",article_5:"Guide TikTok | Voici comment faire un collage vidéo sur TikTok",article_6:"5 façons simples de combiner des fichiers VOB que vous devez connaître",article_7:"Comment améliorer la vidéo et obtenir facilement une résolution plus élevée",article_8:"Comment combiner des fichiers MP4 sur MacBook Pro/iMac/MacBook et plus",article_9:"2 façons simples de supprimer l'historique des achats sur iPhone [Résolu]",article_10:"Comment supprimer définitivement les images Snapchat du chat et des souvenirs",article_11:"Comment supprimer les suggestions et l'historique de recherche Spotlight sur iPhone/iPad",article_12:"[Résolu] Comment effacer le cache Instagram sur iPhone avec 3 manières simples",article_13:"[Résolu] Comment réparer QuickTime Player ne fonctionne pas sur Mac",article_14:"Comment enregistrer l'audio du système sur Mac (Big Sur/Catalina/Mojave …)",article_15:"Moyens efficaces pour réparer l'enregistrement d'écran PowerPoint ne fonctionne pas",article_16:"Comment enregistrer de l'audio avec VLC [Résolu]",faq_title_1:"1. Comment corriger l'erreur 4104 ?",faq_title_2:"2. Quand puis-je récupérer mon argent une fois la demande de remboursement approuvée ?",faq_title_3:"3. Qu'est-ce qu'un « abonnement d'un an » et comment désactiver le « service de renouvellement automatique » ?",faq_title_4:"4. Puis-je annuler ma commande après avoir placé un produit Aiseesoft ?",faq_title_5:"5. Comment soumettre un avis ?",faq_info_1:"Cela est dû à la licence limitée que vous avez. Nous adoptons une licence unique en cas de vol du code d'enregistrement et empêchons l'utilisation abusive du code d'enregistrement. Ainsi, le code Reg que vous avez obtenu est une licence unique qui ne peut être utilisée que sur un seul ordinateur. Si vous l'utilisez sur plusieurs ordinateurs, il y aura l'erreur 4104. Vous ne pouvez pas l'utiliser tant que nous ne l'avons pas réinitialisé pour vous.",faq_info_2:'Si vous modifiez ou réinstallez votre ordinateur, nous pouvons le réinitialiser pour vous. Veuillez contacter le service client : <a href="mailto:support@aiseesoft.fr">support@aiseesoft.fr</a> pour demander la réinitialisation du code d\'enregistrement.',faq_info_3:"Une fois votre demande de remboursement approuvée, il faut normalement 3 à 7 jours ouvrables pour que le crédit apparaisse sur votre compte. Parfois, pendant les vacances, cela peut prendre plus de temps, mais cela ne devrait pas prendre plus de 10 jours. Si vous n'avez pas reçu le remboursement 20 jours après l'approbation, veuillez nous contacter à <a href=\"mailto:support@aiseesoft.fr\">support@aiseesoft.fr</a> pour vérifier le remboursement.",faq_info_4:"Le service de renouvellement automatique signifie que si vous achetez un abonnement d'un an, la plate-forme de paiement facturera le montant automatiquement (y compris les taxes applicables) à l'expiration de la licence du produit. Mais la plateforme de paiement (2Checkout) vous enverra une lettre pour vous rappeler que la commande va expirer 7 jours avant l'expiration. L'e-mail comprendra également des instructions sur la façon de désactiver le « Service de renouvellement automatique ».",faq_info_5:"Étant donné que la commande est traitée automatiquement, il n'est pas permis d'annuler la commande. En outre, la version d'essai gratuite vous permettra d'en savoir plus sur le programme Aiseesoft et de vérifier s'il peut répondre à vos besoins avant de l'acheter.",faq_info_6:'Si vous souhaitez vraiment obtenir un remboursement, veuillez consulter notre <a href="https://www.aiseesoft.fr/politique-remboursement.html">Politique de remboursement</a>.',faq_info_7:'Nous apprécions votre temps et votre attention pour nous soumettre un avis. Contactez-nous (<a href="mailto:support@aiseesoft.fr">support@aiseesoft.fr</a>) pour soumettre votre avis et nous considérerons sérieusement votre avis pour les mises à jour de nos produits.',change_password_success:"Le mot de passe a été changé avec succès",successful_login_title:"Connexion réussie",product_page:"Fiche produit>>",successful_login_info:"Connexion terminée. Veuillez fermer la page actuelle et revenir à l'onglet d'origine pour continuer le processus suivant. La page en cours se fermera automatiquement dans 5 secondes. Si la fermeture automatique ou la fermeture en cliquant sur le bouton \"Terminé\" échoue, veuillez fermer cet onglet directement.",successful_login_info_firefox:"Connexion terminée. Veuillez fermer la page actuelle et revenir à l'onglet d'origine pour continuer le processus suivant.",my_account:"Mon compte",my_history:"Mon histoire",remove_watermark:"Supprimer filigrane",no_history:"Pas d'historique",history_all:"Tout sélectionner",history_open:"Ouvert",history_down:"Télécharger",history_delete:"Supprimer",history_clear:"Effacer invalide",images:"image(s)",use_this_function:"Utiliser cette fonction>>",hd_downloading:"Avantages du téléchargement d'images originales HD :",lifetimeRemaining:"Durée de vie restante",Remaining:"Restant",email_verification:"vérification de l'E-mail",email_verification_info:'Nous avons envoyé le message de vérification à votre adresse e-mail <span class="email"></span>, et veuillez terminer la vérification. Après vérification, les avantages seront synchronisés automatiquement.',wrong_email:"Mauvaise adresse email?",click_here_to_modify:"Cliquez ici pour modifier",get_more_help:"Obtenir plus d'aide ?",click_here:"Cliquez ici",email_verification_info_success:"Félicitations pour la vérification de votre compte de messagerie.",email_verification_info_error:"La vérification a échoué en raison de l'expiration du lien.",registration_succeeded:"Inscription réussie",re